import { Component } from 'react';

import Header from '../Header/Header';
import Search from '../Search/Search';
import Results from '../Results/Results';
import Gallery from '../Gallery/Gallery';
import Detail from '../Detail/Detail';

import './App.css';

function App() {
  var xhr = new XMLHttpRequest();
  xhr.onreadystatechange = xhrHandler;
  xhr.open('get', 'https://www.balldontlie.io/api/v1/players?search=davis');
  xhr.send(null);

  function xhrHandler() {
    if (xhr.readyState == 4 && xhr.status == 200) {
        var data = JSON.parse(xhr.responseText);
        myFunction(data);
    }
  };
  function myFunction(data) {
    var out = "";
    var camelids = data.camelids;
    for(var i = 0; i < camelids.length; i++) {
      out += '<div>' + camelids[i].name + '&nbsp;&nbsp;&nbsp;' + camelids[i].height + '</div>';
    }
    document.getElementById("camelids").innerHTML = out;
  }

  return (
    <div className="App">
        App
    </div>
  );
}

export default App;
